import './App.css';
import Menu from './Menu/Menu';

import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

function App() {
  return (
    <Router className="App">
      <Menu/>
      <div className="mainContainer">
        <Switch>
          <Route path="/">
            <TransactionsPage/>
          </Route>
          <Route path="ReportsPage">
            <ReportsPage/>
          </Route>
          <Route path="AddUserPage">
            <AddUserPage/>
          </Route>
        </Switch>
      </div>

      <ReportsPage/>


    </Router>
  );
}

export default App;
